import {Link} from "react-router-dom";
const NavBar = () => {
    return ( 
        <>
        <nav className="navbar">
            <Link to = "/">Home</Link>
            <Link to = "/phonecases"> Phonecases</Link>
            <Link to = "/checkout"> My Cart</Link>
        </nav>
        </>
     );
}

export default NavBar;
